window.CUCUMBER_MESSAGES = [{"meta":{"protocolVersion":"18.0.0","implementation":{"name":"cucumber-jvm","version":"7.4.1"},"runtime":{"name":"Java HotSpot(TM) 64-Bit Server VM","version":"17.0.9+11-LTS-201"},"os":{"name":"Windows 10"},"cpu":{"name":"amd64"},"ci":{"name":"Jenkins","url":"http://localhost:8080/job/com.LoanTechExperTeam01_smoke_e2e/38/","buildNumber":"38","git":{"remote":"https://github.com/ramazanE56/com.LoanTechExperTeam01.git","revision":"bb64ff68da8251a91ee195c9883ab37befa62e98"}}}},{"testRunStarted":{"timestamp":{"seconds":1703288337,"nanos":561788300}}},{"source":{"uri":"file:///C:/Users/asus/IdeaProjects/com.LoanTechExperTeam01/src/test/resources/features/US34_Suphi.feature","data":"\r\nFeature: US34: As an administrator, I want to be able to access and update my profile information.\r\n\r\n  Background:Users use these steps to log in to the site.\r\n\r\n@smoke\r\n  Scenario: TC01: After logging in to the admin dashboard, the admin icon should appear in the upper right corner.\r\n\r\n    * The visitor enters the admin site with the given \"adminUrl\"\r\n    * The admin logs in to the admin dashboard page with \"adminNameSuphi\" and \"passwordAdmin\"\r\n    * Click on the admin icon in the upper right corner of the admin dashboard page\r\n    * Close the page\r\n\r\n  Scenario: TC02: When clicking on the admin icon, profile, password, logout links should appear.\r\n\r\n    * The visitor enters the admin site with the given \"adminUrl\"\r\n    * The admin logs in to the admin dashboard page with \"adminNameSuphi\" and \"passwordAdmin\"\r\n    * Click on the admin icon in the upper right corner of the admin dashboard page\r\n    * The visibility of Admin, Profile, Password, Logout links is verified\r\n    * Close the page\r\n\r\n  Scenario: TC03: Clicking on the profile link should take you to the Profile Information page and\r\n                  information updates should be possible.\r\n\r\n    * The visitor enters the admin site with the given \"adminUrl\"\r\n    * The admin logs in to the admin dashboard page with \"adminNameSuphi\" and \"passwordAdmin\"\r\n    * Click on the admin icon in the upper right corner of the admin dashboard page\r\n    * Click on the profile link\r\n    * Name, email, image information is updated and saved\r\n    * It is confirmed that the changes made have been saved successfully by the text Profile updated successfully in the upper right corner\r\n    * Close the page\r\n\r\n  Scenario: TC04: Clicking on the password link should take you to the password setting page and\r\n                  you should be able to update the password.\r\n\r\n    * The visitor enters the admin site with the given \"adminUrl\"\r\n    * The admin logs in to the admin dashboard page with \"adminNameSuphi\" and \"passwordAdmin\"\r\n    * Click on the admin icon in the upper right corner of the admin dashboard page\r\n    * Click on the password link and go to the password setting page\r\n    * In the Change password section, used Password, New Password and Confirm Password information must be entered\r\n    * It is confirmed that the changes made have been saved successfully by the text Password changed successfully in the upper right corner\r\n    * Close the page\r\n\r\n  Scenario: TC05: When the Logout link is clicked, you must successfully leave the page.\r\n\r\n    * The visitor enters the admin site with the given \"adminUrl\"\r\n    * The admin logs in to the admin dashboard page with \"adminNameSuphi\" and \"passwordAdmin\"\r\n    * Click on the admin icon in the upper right corner of the admin dashboard page\r\n    * Click on the profile link\r\n    * Click on the admin icon in the upper right corner of the admin dashboard page\r\n    * Click on the logout link\r\n    * It is verified that the admin page is exited\r\n    * Close the page\r\n\r\n","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:///C:/Users/asus/IdeaProjects/com.LoanTechExperTeam01/src/test/resou on selected from the list,Date, Trx Number,\r\n          User Name, Method, Amount, Fee, After Fee, Rate, Payable, Status information should be displayed.\r\n  * Display the Deposits item in the Dashboard menu and click on it\r\n  * Click on Approved Deposits button\r\n  * Admin displays and clicks the Details button below the Action titles\r\n  * Admin Displays details on the detail page of the withdrawal selected from the list\r\n  * Close the page","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:///C:/Users/asus/IdeaProjects/com.LoanTechExperTeam01/src/test/resources/features/US52_Umit.feature","feature":{"location":{"line":1,"column":1},"tags":[],"language":"en","keyword":"Feature","name":"As an  admin, I want to have an Approved Deposit page to","description":"         view deposit transactions approved by the admin.","children":[{"background":{"location":{"line":4,"column":3},"keyword":"Background","name":"Admin use these steps to log in to the site and Admindashboard.","description":"","steps":[{"location":{"line":5,"column":5},"keyword":"* ","text":"As admin, go to \"adminUrl\" Adminpage","id":"3e22af9b-0ad1-48ff-a36f-09eaf0a53e6c"},{"location":{"line":6,"column":5},"keyword":"* ","text":"Enter \"adminNameUmit\" and \"passwordAdmin\" and press the login button.","id":"cda78f9f-b711-4c6a-96c5-4f2ccb9fb4c0"}],"id":"dd14adc3-baca-46b9-87e0-55093e1041f2"}},{"scenario":{"location":{"line":8,"column":1},"tags":[{"location":{"line":7,"column":1},"name":"@smoke","id":"40e88ce5-f5e5-48d1-b93a-5c2cffa8a41f"}],"keyword":"Scenario","name":"TC_01:Admin accesses the admin/deposit/approved page by clicking on the","description":"          Approved Deposits page link under the Admin Deposits menu title","steps":[{"location":{"line":10,"column":3},"keyword":"* ","text":"Display the Deposits item in the Dashboard menu and click on it","id":"c191d7da-e516-4c24-a50d-e58b7e821f6b"},{"location":{"line":11,"column":3},"keyword":"* ","text":"Click on A ,"id":"9e83a4f8-0f23-420f-aaf1-516a6c263e4e","text":"Enter \"adminNameUmit\" and \"passwordAdmin\" and press the login button."},{"astNodeIds":["6bdb27a5-495c-4653-a5ee-860532436b86"],"id":"dfa9be96-098e-4bd2-a144-d3e5c6945f49","text":"Display the Deposits item in the Dashboard menu and click on it"},{"astNodeIds":["52e2f094-bbfb-42b3-8a66-58fab5046503"],"id":"4bc200cb-0850-47de-ab6b-08c2ae958e8a","text":"Click on Approved Deposits button"},{"astNodeIds":["02d75a52-7944-4e04-b774-db6b3416cbf9"],"id":"709eec7a-0e6b-458b-b8d4-d8718f7959e3","text":"Admin displays and clicks the Details button below the Action titles"},{"astNodeIds":["bbf5e155-251b-4415-924e-729aacb1ed2e"],"id":"94950dc4-41dc-4fd2-8706-d66fa08844df","text":"Admin Displays details on the detail page of the withdrawal selected from the list"},{"astNodeIds":["774796ca-da1a-4c4d-b92c-daf8000fcfe5"],"id":"43e99c2f-7157-4984-8f31-3d6b960848b7","text":"Close the page"}],"tags":[],"astNodeIds":["344339f3-b3b6-49c5-a004-f6855a16e96e"]}},{"source":{"uri":"file:///C:/Users/asus/IdeaProjects/com.LoanTechExperTeam01/src/test/resources/features/US37_Halit.feature","data":"\r\n\r\n    Feature: As an Administrator, I want to have a page on the site where I can see active users and manage balance\r\n      transactions.\r\n\r\n      Background:  Background: In this step, the registered user reaches the user home page\r\n      by entering his username and password.\r\n        * The administrator goes to the web page with the given \"adminUrl\".\r\n        * The administrator enters a valid \"usernameHalit\" in the username box.\r\n        * The administrator enters a valid \"passwordAdmin\" in the password box.\r\n        * The administrator clicks on the login button.\r\n        * The administrator clicks the manage users button under the Dashboard.\r\n      @smoke\r\n      Scenario: TC_01 The 'Active Users' link should appear and be active under the 'Manage Users'\r\n            link in the Naw bar on the Dashboard page.\r\n\r\n        * Verify that the Active Users button is visible and active.\r\n\r\n      Scenario: TC_02 When the 'Active Users' link is clicked, the 'Active Users List' and list\r\n      titles should be displayed.\r\n\r\n        * The administrator clicks Active Users button\r\n        * Verify that the  Active Users List and list titles appears.\r\n\r\n\r\n      Scenario: TC_03 To access information about any user selected from the list, the 'Details'\r\n      button must be visible and active. When clicked, it should redirect to the 'User Detail - Username' page.\r\n\r\n        * The administrator clicks Active Users button\r\n        * Verify that the Details button is visible and active.\r\n        * The administrator clicks  the Details button.\r\n        * It is verified that the User Details-Username page is opened.\r\n\r\n      Scenario: TC_04 On the User Detail page, under the 'Balance' heading, the 'view all' icon should be\r\n      visible and active. When the icon is clicked, it should direct you to the 'Transaction Logs' page.\r\n\r\n        * The administrator clicks Active Users button\r\n        * The administrator clicks  the Details button.\r\n        * The administrator clicks View All icon.\r\n        * It is verified that the Transaction Logs page is opened.\r\n\r\n      Scenario: TC_05 List and list titles should be displayed on the page that opens.\r\n\r\n        * The administrator clicks Active Users button\r\n        * The administrator clicks  the Details button.\r\n        * The administrator clicks View All icon.\r\n        * It is verified that the list and list titles are displayed on the Transaction Logs page.\r\n\r\n      @a\r\n      Scenario: TC_06 To search within the list, filter icons must be visible and active.\r\n\r\n        * The administrator clicks Active Users button\r\n        * The administrator clicks  the Details button.\r\n        * The administrator clicks View All icon.\r\n        * The TRX Username box appears and confirms that it is active.\r\n        * The Type box appears and confirms that it is active.\r\n        * The Remark box appears and confirms that it is active.\r\n        * The Date box appears and confirms that it is active.\r\n        * The filter icon appears and confirms that it is active.\r\n\r\n      @wip\r\n      Scenario: TC_07 The 'Add Balance' Button should be visible and active on the Active Users Page. When\r\n      clicked, it should direct you to the Add Balance page.\r\n        * The administrator clicks Active Users button\r\n        * The administrator clicks  the Details button.\r\n        * The Add Balance button appears and confirms that it is active.\r\n        * The administrator clicks Add Balance button.\r\n        * It is verified that the Add Balance page is opened.\r\n\r\n      @wip\r\n      Scenario: TC_08 The Amount and Remark text boxes on the Add Balance page should be visible and\r\n          characters should be entered.\r\n\r\n        * The administrator clicks Active Users button\r\n        * The administrator clicks  the Details button.\r\n        * The administrator clicks Add Balance button.\r\n        * Amount text box appears and it is verified that characters can be entered.\r\n        * Remark text box appears and it is verified that characters can be entered.\r\n\r\n      Scenario: The 'Submit Button' on the page must be visible and active. When clicked, the text\r\n      '$x added successfully' should be displayed.\r\n\r\n        * The administrator clicks Active Users button\r\n        * The administrator clicks  the Details button.\r\n        * The administrator clicks Add Balance button.\r\n        * The amount is entered in the Amount text box.\r\n        * A description is entered in the Remark text box.\r\n        * The Submit button appears and confirms that it is active.\r\n        * The administrator clicks Submit button.\r\n        * It is verified that the text $ 1 added successfully is seen.","mediaType":" 1/src/test/resources/features/US12_Ismail.feature","data":"\r\nFeature: I would like to have a page to register as a visitor\r\n\r\n  Background:Users use these steps to log in to the site.\r\n\r\n    * The visitor enter site given \"Url\"\r\n\r\n\r\n  @smoke\r\n  Scenario: TC01 : It must be verified that the Get Started Button Link is visible and active on the Home Page.\r\n\r\n    * Verify that the Get Started Button link is Visible on the Home Page\r\n    * Click on the Get Started Button on the Home Page.\r\n    * Verify that the register text is visible on register page.\r\n    * Close the page\r\n\r\n\r\n  @e2e\r\n  Scenario: TC02 : Verify that the registration form is visible on the registration page\r\n    * Click on the Get Started Button on the Home Page.\r\n    * Verify that the Welcome To Loantech Expert form title is visible on the Register page\r\n    * Close the page\r\n\r\n\r\n  Scenario: TC03 : It must be verified that the Username, Email Address, Country DropDown,\r\n            Mobile Number, Password, Confirm Password text boxes are visible in the form.\r\n\r\n    * Click on the Get Started Button on the Home Page.\r\n    * Verify that the username text box is visible\r\n    * Verify that the Email Address text box is visible\r\n    * Verify that the Country DropDown is visible\r\n    * Verify that the Mobile Number text box is visible\r\n    * Verify that the Password text box is visible\r\n    * Verify that the Confirm Password text box is visible\r\n    * Close the page\r\n\r\n\r\n  Scenario: TC04 : It must be verified that a unique value of at least 6 characters can be entered in the Username box.\r\n\r\n    * Click on the Get Started Button on the Home Page.\r\n    * A unique username with at least 6 characters is entered in the Username box.\r\n    * Close the page\r\n\r\n\r\n  Scenario: TC05 : It must be verified that valid e-mail information containing\r\n            the @ sign can be entered in the e-mail text box.\r\n\r\n    * Click on the Get Started Button on the Home Page.\r\n    * A unique username with at least 6 characters is entered in the Username box.\r\n    * It is verified that valid e-mail information containing the @ sign can be entered in the e-mail text box\r\n    * Close the page\r\n\r\n\r\n  Scenario: TC06 : It must be verified that country selection is possible from the Country menu.\r\n\r\n    * Click on the Get Started Button on the Home Page.\r\n    * A unique username with at least 6 characters is entered in the Username box.\r\n    * Valid e-mail information containing the @ sign is entered into the e-mail text box\r\n    * It is verified that country selection is possible from the Country menu.\r\n    * Close the page\r\n\r\n\r\n  Scenario: TC07 : It must be verified that country selection is possible from the Country menu.\r\n\r\n    * Click on the Get Started Button on the Home Page.\r\n    * A unique username with at least 6 characters is entered in the Username box.\r\n    * Valid e-mail information containing the @ sign is entered into the e-mail text box\r\n\r\n\r\n    * Country selection is made from the Country menu.\r\n    * It is verified that a unique phone number of up to 14 digits can be entered in the phone textbox.\r\n    * Close the page\r\n\r\n\r\n  Scenario: TC08 : It must be verified that a 6-digit password containing at least\r\n            one uppercase letter, one number, lowercase letter and character can be entered in the\r\n            Password textbox and that the entered password can be hidden or unlocked.\r\n\r\n    * Click on the Get Started Button on the Home Page.\r\n    * A unique username with at least 6 characters is entered in the Username box.\r\n    * Valid e-mail information containing the @ sign is entered into the e-mail text box\r\n    * Country selection is made from the Country menu.\r\n    * A unique phone number of maximum 14 digits is entered into the phone textbox.\r\n    * It is verified that a 6-digit password containing at least one uppercase letter, one number, lowercase letter and character can be entered in the Password textbox.\r\n    * It is verified that the password entered in the password textbox can be hidden or revealed.\r\n    * Close the page\r\n\r\n\r\n  Scenario: TC009 : It must be verified that the password specified in the Confirm textbox can be re-entered.\r\n\r\n    * Click on the Get Started Button on the Home Page.\r\n    * A unique username with at least 6 characters is entered in the Username box.\r\n    * Valid e-mail information containing the @ sign is entered into the e-mail text box\r\n    * Country selection is made from the Country menu.\r\n    * A unique phone number of maximum 14 digits is entered into the phone textbox.\r\n    * A 6-digit password containing at least one uppercase letter, one number, lowercase letter and character is entered into the Password textbox.\r\n    * It is verified that the password specified in the Confirm textbox can be entered again.\r\n    * Close the page\r\n\r\n\r\n  Scenario: TC10 : Verify that the 'I agree with Privacy Policy, Terms of Service, Rapid Policy' check box is clickable\r\n\r\n    * Click on the Get Started Button on the Home Page.\r\n    * Verify that the I agree with Privacy Policy, Terms of Service, Rapid Policy check box is clickable\r\n    * Close the page\r\n\r\n\r\n  Scenario: TC11 : By clicking on the Register button, the user registration form must\r\n            be submitted and it must be verified that it can be directed to the User Data page to complete the registration.\r\n\r\n    * Click on the Get Started Button on the Home Page.\r\n    * A unique username with at least 6 characters is entered in the Username box.\r\n    * Valid e-mail information containing the @ sign is entered into the e-mail text box\r\n    * Country selection is made from the Country menu.\r\n    * A unique phone number of maximum 14 digits is entered into the phone textbox.\r\n    * A 6-digit password containing at least one uppercase letter, one number, lowercase letter and character is entered into the Password textbox.\r\n    * The specified password is entered in the Confirm textbox.\r\n    * click on the i agree button\r\n    * click on the register button\r\n    * Verify that Please Complete Your Profile is visible\r\n    * Close the page\r\n\r\n\r\n    Scenario: TC12 : It appears in the form opened on the User Data page\r\n              (firstname, lastname, address, State, Zip, city, Submit Button) and must be verified as active.\r\n\r\n      * Click on the Get Started Button on the Home Page.\r\n      * A unique username with at least 6 characters is entered in the Username box.\r\n      * Valid e-mail information containing the @ sign is entered into the e-mail text box\r\n      * Country selection is made from the Country menu.\r\n      * A unique phone number of maximum 14 digits is entered into the phone textbox.\r\n      * A 6-digit password containing at least one uppercase letter, one number, lowercase letter and character is entered into the Password textbox.\r\n      * The specified password is entered in the Confirm textbox.\r\n      * click on the i agree button\r\n      * click on the register button\r\n      * The Firstname box should be visible\r\n      * The lastname box should be visible\r\n      * The address box should be visible\r\n      * The State box should be visible\r\n      * The Zip box should be visible\r\n      * The city box should be visible\r\n      * The Submit Button should be visible\r\n      * Submit Button must be clickable\r\n      * Close the page\r\n\r\n\r\n    Scenario: TC13 : It must be verified that the registration process\r\n              can be completed by filling in the mandatory fields in the form (firstname/lastname/address textboxes).\r\n\r\n      * Click on the Get Started Button on the Home Page.\r\n      * A unique username with at least 6 characters is entered in the Username box.\r\n      * Valid e-mail information containing the @ sign is entered into the e-mail text box\r\n      * Country selection is made from the Country menu.\r\n      * A unique phone number of maximum 14 digits is entered into the phone textbox.\r\n      * A 6-digit password containing at least one uppercase letter, one number, lowercase letter and character is entered into the Password textbox.\r\n      * The specified password is entered in the Confirm textbox.\r\n      * click on the i agree button\r\n      * click on the register button\r\n      * Name is entered in the firstname box\r\n      * Surname is entered in the lastname box\r\n      * Address is entered in the address box\r\n      * State is entered in the state box\r\n      * zip code entered in zip code box\r\n      * Country is entered in the city box\r\n      * Click on the submit button\r\n      * Verify that registration process completed successfully appears\r\n      * Close the page\r\n\r\n\r\n\r\n\r\n\r\n","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:///C:/Users/asus/IdeaProjects/com.LoanTechExperTeam01/src/test/resources/features/US12_Ismail.feature","feature":{"location":{"line":2,"column":1},"tags":[],"language":"en","keyword":"Feature","name":"I would like to have a page to register as a visitor","description":"","children":[{"background":{"location":{"line":4,"column":3},"keyword":"Background","name":"Users use these steps to log in to the site.","description":"","steps":[{"location":{"line":6,"column":5},"keyword":"* ","text":"The visitor enter site given \"Url\"","id":"64427394-2332-4212-8bba-bd88728ec719"}],"id":"93dab789-9720-4991-af96-6f43f76a56bd"}},{"scenario":{"location":{"line":10,"column":3},"tags":[{"location":{"line":9,"column":3},"name":"@smoke","id":"36e7c537-072a-4534-899c-4a1c4d8143a7"}],"keyword":"Scenario","name":"TC01 : It must be verified that the Get Started Button Link is visible and active on the Home Page.","description":"","steps":[{"location":{"line":12,"column":5},"keyword  * User, Email-Phone, Country, Joined At, Balance, Action information of Active Users are displayed\r\n    * Close the page\r\n\r\n  Scenario: TC03: To access information about any user selected from the list, the 'Details' button must be visible and active.\r\n                  when clicked, it should redirect to the 'User Detail - Username' page.\r\n\r\n    * The visitor enters the admin site with the given \"adminUrl\"\r\n    * The admin logs in to the admin dashboard page with \"adminNameSuphi\" and \"passwordAdmin\"\r\n    * Click on the Manage Users link\r\n    * Click on Active Users link under Manage Users link and go to Active Users page\r\n    * User, Email-Phone, Country, Joined At, Balance, Action information of Active Users are displayed\r\n    * Click on the Details link under the Action information of an Active User\r\n    * Go to User Details page\r\n    * Close the page\r\n\r\n  Scenario: TC04: The selected user's current profile information should be directed to the editing screen.\r\n                  Basic information such as 'name, surname, e-mail, phone' should be editable.\r\n                  Other private information about the user (if any) should be displayed and updated on the editing screen.\r\n                  The validity of the updated information should be checked. For example, it should be checked whether\r\n                  the email address is in the correct format. Required fields cannot be left blank.\r\n\r\n    * The visitor enters the admin site with the given \"adminUrl\"\r\n    * The admin logs in to the admin dashboard page with \"adminNameSuphi\" and \"passwordAdmin\"\r\n    * Click on the Manage Users link\r\n    * Click on Active Users link under Manage Users link and go to Active Users page\r\n    * User, Email-Phone, Country, Joined At, Balance, Action information of Active Users are displayed\r\n    * Click on the Details link under the Action information of an Active User\r\n    * Go to User Details page\r\n    * The name and surname information under the heading Information of is reorganized and saved\r\n    * The email address under the Information of heading is rearranged and saved in the correct format (there must be an \"@\" sign in the email address)\r\n    * City information under the Information of heading is reorganized and saved\r\n    * The State information under the Information of heading is reorganized and saved\r\n    * Zip code information under the Information of heading is rearranged and saved\r\n    * Close the page\r\n\r\n  Scenario: TC05: When the changes are approved, the user profile information in the system must be updated.\r\n                  The user should be shown a notification that the changes were successfully saved.\r\n\r\n    * The visitor enters the admin site with the given \"adminUrl\"\r\n    * The admin logs in to the admin dashboard page with \"adminNameSuphi\" and \"passwordAdmin\"\r\n    * Click on the Manage Users link\r\n    * Click on Active Users link under Manage Users link and go to Active Users page\r\n    * User, Email-Phone, Country, Joined At, Balance, Action information of Active Users are displayed\r\n    * Click on the Details link under the Action information of an Active User\r\n    * Go to User Details page\r\n    * The information under the Information of heading is rearranged and saved by clicking Submit button\r\n    * Changes are confirmed by the 'User details updated successfully' notification in the upper right corner of the page\r\n    * Close the page\r\n@smoke\r\n  Scenario: TC06: When an unexpected error occurs in the system, a clear error message should be displayed to the user.\r\n                  In case of incorrect entries (invalid e-mail, missing mandatory fields, etc.), the user should be informed\r\n                  with appropriate error messages.\r\n\r\n    * The visitor enters the admin site with the given \"adminUrl\"\r\n    * The admin logs in to the admin dashboard page with \"adminNameSuphi\" and \"passwordAdmin\"\r\n    * Click on the Manage Users link\r\n    * Click on Active Users link under Manage Users link and go to Active Users page\r\n    * User, Email-Phone, Country, Joined At, Balance, Action information of Active Users are displayed\r\n    * Click on the Details link under the Action information of an Active User\r\n    * Go to User Details page\r\n    * An attempt is made to enter missing - incorrect address information to the \"e_mail\" address\r\n    * Please add an \"@\" sign to the email address. The \"@\" is missing in the \"e_mail\" address.' incorrect input notification is displayed\r\n    * Close the page\r\n","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:///C:/Users/asus/IdeaProjects/com.LoanTechExperTeam01/src/test/resources/features/US45_Suphi.feature","feature":{"location":{"line":2,"column":1},"tags":[],"language":"en","keyword":"Feature","name":"US45: As an administrator, I want to be able to edit the profile information of a user I choose.","description":"","children":[{"background":{"location":{"line":4,"column":3},"keyword":"Background","name":"Users use these steps to log in to the site.","description":"","steps":[],"id":"01891e9b-301e-4db2-bd6a-9dd0b5789e94"}},{"scenario":{"location":{"line":7,"column":3},"tags":[],"keyword":"Scenario","name":"TC01: The 'Active Users' link should appear and be active under the 'Manage Users' link","description":"                  in the Nawbar on the Dashboard page.","steps":[{"location":{"line":10,"column":5},"keyword":"* ","text":"The visitor enters the admin site with the given \"adminUrl\"","id":"6dae644d-e0c9-4606-91dc-240f3e07d024"},{"location":{"line":11,"column":5},"keyword":"* ","text":"The admin logs in to the admin dashboard page with \"adminNameSuphi\" and \"passwordAdmin\"","id":"479188da-6578-4b28-a5aa-3386c020387f"},{"location":{"line":12,"column":5},"keyword":"* ","text":"Click on the Manage Users link","id":"26964640-309f-418e-b862-4a1c4f29d2
